Chart colorings.

Holds an object with information about the possible options how colors can be applied for indicating Criticality or Emphasis in the chart. 
Colorings: {
    Criticality: {
        …
    },
    Emphasis: {
        …
    }
}


NOTE: Dimension-based coloring does not work when {@link sap.chart.data.Measure#setSemantics} is set to {@link sap.chart.data.MeasureSemantics.Projected} or {@link sap.chart.data.MeasureSemantics.Reference} for visible measure(s).

Refer to {@link sap.chart.ColoringType.Criticality} {@link sap.chart.ColoringType.Emphasis} for detailed usage

Active coloring configurations.

specifies which coloring of the possible colorings is to be applied for the current chart layout. It holds an object with two properties：

 coloring: mandatory, specify which kind of coloring should take effect in current chart layout. Possible values refer to {@link sap.chart.ColoringType} parameters:   Criticality supports two parameters: "dimension" and "measure". Both are optional, one (and only one) must be provided. This setting disambiguates when multiple colorings for different visible dimensions and measures are applicable.

"measure" supports two input types:  string for single measure name string[] of multiple measure names(only supported in static), which is relevant in case of a static measure criticality defined on multiple measures.  "dimension" holds the dimension name as string value.   Emphasis supports only one parameter: "dimension" which is optional.

"dimension" holds the dimension name as string value.    

Example: 
activeColoring: {
    coloring: sap.chart.ColoringType.Criticality,
    parameters: {
        dimension: "AvailabilityStatus”
    }
}

Value Axis Scale.

Specifies the scale of the chart value axes.

 scaleBehavior: optional, determines whether or not all value axes in the chart should have a fixed scale. Possible values refer to {@link sap.chart.ScaleBehavior}. The default value is sap.chart.ScaleBehavior.AutoScale. In order to apply a fixed scale, boundary values for minimum and maximum must have been specified for all visible measures, and the axes boundaries are then created from the largest maximum and the smallest minimum value of the measures put on the respective axis. If any visible measure lacks this information, or scaleBehavior is set to sap.chart.ScaleBehavior.AutoScale, the chart will apply an automatic scaling for all value axes.  fixedScaleSettings:  measureBoundaryValues: An object holding the fixed “minimum” and “maximum” values for all the measures. Stacked chart with only one measure also uses this object to describe the fixed “minimum” and “maximum” value.   measure Measure name    stackedMultipleMeasureBoundaryValues: An array of objects holding the fixed “minimum” and “maximum” values only for stacked chart with multiple measures.   measures the array of measure name applied to the axis.   boundaryValues： An object holding the fixed “minimum” and “maximum” value all the measures applied to certain axis.      autoScaleSettings:   zeroAlwaysVisible forces the value axis to always display the zero value (only a few chart types support the opposite), which is optional. The default value is true.   syncWith selects how the chart adapts the value axis to the data: The axis boundaries may be determined from the loaded data, which is optional. The default value is "DataSet". Possible values refer to {@link sap.chart.AutoScaleMode}.    

Example: 
valueAxisScale: {
    scaleBehavior: sap.chart.ScaleBehavior,
    fixedScaleSettings: {
        measureBoundaryValues: {
            measure_1: {
                minimum: Number,
                maximum: Number
            },
            measure_2: {
                minimum: Number,
                maximum: Number
            }
        },
        stackedMultipleMeasureBoundaryValues: [{
            measures: [ 'measure_1', 'measure_2', … ],
            boundaryValues： {
                minimum: Number,
                maximum: Number
            }
        }， {
            measures: [ 'measure_3', 'measure_4', … ],
            boundaryValues： {
                minimum: Number,
                maximum: Number
            }
        }]
    },
    autoScaleSettings: {
        zeroAlwaysVisible: Boolean,
        syncWith: sap.chart.autoScaleMode
    }
}


Refer to {@link sap.chart.AutoScaleMode.DataSet} {@link sap.chart.AutoScaleMode.VisibleData} {@link sap.chart.ScaleBehavior.AutoScale} {@link sap.chart.ScaleBehavior.FixedScale} for detailed usage

