Configuration of shape data names and the attribute in raw data that serves as 'id'.

This property value should be an array, either an array of string, each string represents one available shape data name, or an array of object, each object specifies the shape data name and data attribute that will serves as 'id'. This configuration must be provided if SVG graphics are needed.

Example:  new sap.gantt.GanttChartWithTable({ shapeDataNames: ["task", "order"], shapes: [ new sap.gantt.shape.Shape({ key: "calendar", shapeDataName: "task" shapeClassName: "sap.gantt.shape.Rectangle", // ... }) ] // ... }); 

or in XMLView  &lt;GanttChartWithTable shapeDataNames="task,order"&gt; &lt;/GanttChartWithTable&gt;

animationSettings - A JSON object used to apply animation to the color of the specified shape.  "values": null - A list of values defining the sequence of colors appearing during animation. "duration": "1s" - Denotes the duration of the animation. The value must be greater than 0, and can be expressed in hours(h), minutes(m), seconds(s), or milliseconds(ms). "repeatCount": "indefinite" - Denotes the number of times an animation repeats.  Restriction: Enter at least two colors in the values key for the animation to work. If duration and repeatCount are unspecified, the default values (duration '1s' and repeatCount 'indefinite') are set. Note: This is only applicable for animation of shapes in Gantt charts. This is not applicable for utilization charts. Refer to an example below: 
{
	  "values": "#800;#f00;#800;#800",
	  "duration": "1s",
	  "repeatCount": "indefinite"
}

Flag to show or hide the Export Button for a Table. Note:CustomData - Mandatory field for Export table to Excel functionality. It contains properties that can be configured based on the column configuration, where the key name is restricted to exportTableColumnConfig. The custom data is created for aggregation of columns in a table. Export to excel feature is supported for both OData and JSON models, with a restriction that the tree structure converts to a flat array for a JSON model. The fields supported in the custom data are:  leadingProperty - DataSource field for a column. This is a mandatory field. columnKey - Identifier for individual columns. dataType - Data type for the given column element. The supported data types are dateTime, stringDate, date, time, boolean, string and numeric. isCurrency - Boolean value to determine if the column type contains Currency. unit - Text to display as the unit of measurement of a numeric value. unitProperty - Name of the DataSource field that contains the unit/currency texts. scale - Number of digits after the decimal point of numeric values. precision - Precision for numeric values. displayFormat - Date format to be displayed. The default for dateTime is DD-MM-YY HH:MM, and the default for date is DD-MM-YY. hierarchyNodeLevel - DataSource field which contains the hierarchy level. This is currently supported only for OData models. wrap - Boolean value to determine whether the contents of the table should be wrapped.  Example: 

		&lt;Column sortProperty="ObjectName" filterProperty="ObjectName"&gt;
			&lt;customData&gt;
				&lt;core:CustomData key="exportTableColumnConfig"
					value='{"columnKey": "ObjectName",
	 				"leadingProperty":"ObjectName",
					"dataType": "string",
					"hierarchyNodeLevel": "HierarchyNodeLevel",
					"wrap": true}' /&gt;
			&lt;/customData&gt;
			&lt;m:Text text="Object Name"/&gt;
			&lt;template&gt;
				&lt;m:Label text="{data>ObjectName}"/&gt;
			&lt;/template&gt;
		&lt;/Column&gt;

