A valid XML fragment that contains an &lt;svg&gt; element that complies with the following requirements:  It includes no SVG groups (&lt;g&gt; elements). It includes no &lt;defs&gt; elements.  The SVG element is transformed into a status indicator shape in the following way:  The viewBox attribute of the root SVG element is respected and kept after the transformation. The inline styles of SVG shapes are respected, and shapes with such inline styles are not considered to be fillable. The SVG shapes without classes are considered fillable. If there are multiple fillable shapes, each shape element must have a data-shape-id attribute that is set to a unique value.  Example: 
  &lt;svg version=&quot;1.1&quot; xmlns=&quot;http://www.w3.org/2000/svg&quot; xmlns:xlink=&quot;http://www.w3.org/1999/xlink&quot; viewBox=&quot;0 0 30 30&quot; xml:space=&quot;preserve&quot;&gt;
     &lt;path style=&quot;fill:blue;&quot; d=&quot;M14.664,29....&quot; /&gt;
     &lt;path style=&quot;fill:blue;&quot; d=&quot;M13.626,25....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-1&quot; d=&quot;M15.337,21....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-2&quot; d=&quot;M13.626,17....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-3&quot; d=&quot;M15.337,14....&quot; /&gt;
     &lt;path data-shape-id=&quot;fill-4&quot; d=&quot;M13.107,10....&quot; /&gt;
  &lt;/svg&gt;
 The first two paths in this example are filled with blue color. The last four shape elements are filled gradually, as the status indicator's value changes.

Please note that the SVG element must be escaped when used directly as an attribute in the XML view.

Provides customization to the columns/cell templates generated by the SmartTable control.

List of supported settings for the customizeConfig property:  textInEditModeSource: For more information, see {@link sap.ui.comp.smartfield.SmartField#setTextInEditModeSource} insertIgnoreRestrictions: The customData setting for the sap.ui.comp.smartfield.SmartField control. Supported as of version 1.103.   Examples for the customizeConfig property to change the textInEditModeSource for the default smartField 
&lt;!-- Sets the textInEditModeSource property of all the SmartField controls to ValueList --&gt;
&lt;SmartTable customizeConfig="{'textInEditModeSource': {'*': 'ValueList'}}" &gt;

&lt;!-- Sets the textInEditModeSource property of the smartField with path "Bukrs" to NavigationProperty and
others to ValueList  --&gt;
&lt;SmartTable customizeConfig="{'textInEditModeSource': {'*': 'ValueList','Bukrs':'NavigationProperty'}}" &gt;

Enables heuristic column width calculation for all supported table types based on metadata information when set to true. The column width calculation takes OData type, column label, text arrangement, possible cell templates, additional fields and many other metadata parameters into account. Providing more precise MaxLength value for the Edm.String type or precision value for numeric OData types can help this algorithm to produce better results. The calculated column widths can have a minimum of 3rem and a maximum of 20rem. To avoid the heuristic column width calculation for a particular column, the {@link #annotation:CssDefaults CssDefaults} annotation can be used.

If tableType="ResponsiveTable", the following changes are applied:  {@link #getDemandPopin demandPopin} property of the SmartTable is set to true. {@link sap.m.Table#getFixedLayout fixedLayout} property of the inner table is set to Strict. {@link sap.m.Table#getContextualWidth contextualWidth} property of the inner table is set to Auto. Column resizing feature gets enabled and the wrapping of column headers get disabled for all columns, including custom columns.  Those properties must not be managed by the application.

By default, this feature has no effect on custom columns. To enable heuristic column width calculation also for custom columns, the autoColumnWidth property must be specified in the p13nData custom data. Note: The automatic column width calculation for custom columns works only when the width property of the custom column is not set. Note: The custom columns can have unexpected cell templates that might affect the result of the column width calculation, for example, an Edm.Byte field that can only have three digits might be visualized as a sap.m.RatingIndicator that requires more space. Note: Defining the leadingProperty and a unique columnKey in the p13nData custom data is a prerequisite for all other p13nData properties, including the autoColumnWidth property. Examples with autoColumnWidth property of the p13nData custom data 
&lt;!-- Enable the automatic column width calculation for a custom column --&gt;
&lt;Column customdata:p13nData='\{&quot;autoColumnWidth&quot;: true, &quot;leadingProperty&quot;: &quot;PropA&quot;, &quot;columnKey&quot;: &quot;PropA&quot;}' &gt;

&lt;!-- Restrict the automatic width calculation to a minimum of 5rem and a maximum of 15rem --&gt;
&lt;Column customdata:p13nData='\{&quot;autoColumnWidth&quot;: \{ &quot;min&quot;: 5, &quot;max&quot;: 15 }, &quot;leadingProperty&quot;: &quot;PropA&quot;, &quot;columnKey&quot;: &quot;PropA&quot;}' &gt;

&lt;!-- Define extra 3rem space to the automatic content width calculation --&gt;
&lt;Column customdata:p13nData='\{&quot;autoColumnWidth&quot;: \{ &quot;gap&quot;: 3 }, &quot;leadingProperty&quot;: &quot;PropA&quot;, &quot;columnKey&quot;: &quot;PropA&quot;}' &gt;

&lt;!-- Define the visible properties that should be considered for the calculation. Multiple property names can be specified here as comma-separated values. The first property is the leading property. --&gt;
&lt;Column customdata:p13nData='\{&quot;autoColumnWidth&quot;: \{ &quot;visibleProperty&quot;: &quot;PropC&quot; }, &quot;leadingProperty&quot;: &quot;PropA&quot;, &quot;additionalProperty&quot;: &quot;PropB,PropC&quot;, &quot;columnKey&quot;: &quot;PropA&quot;}' &gt;

&lt;!-- The calculated column width must not be smaller than the column header --&gt;
&lt;Column customdata:p13nData='\{&quot;autoColumnWidth&quot;: \{ &quot;truncateLabel&quot;: false }, &quot;leadingProperty&quot;: &quot;PropA&quot;, &quot;columnKey&quot;: &quot;PropA&quot;}' &gt;


Note: The enableAutoColumnWidth is not a dynamic property and cannot be changed once the control has been initialized.

