 Where:  label = text string for the property editor label type = one of the registered property editors types in {@link sap.ui.integration.designtime.baseEditor.BaseEditor BaseEditor configuration} (see propertyEditors section) path = a binding path to get data from

Defines a list of configuration settings, which will be merged into the original manifest.

This can be a list of flexibility changes generated during designtime.

Each item in the array represents a separate level of changes. For example, the first item might be created by an administrator, the second by a page administrator and the third by the end user.

The order of the items is the order in which the changes will be merged on top of each other. So the last item will overwrite the previous items where the paths match.

Example: 
[
	{
		// Administrator
		"/sap.card/header/title": "My Configured Title in Default Language",
		"/sap.card/content/maxItems": 10,
		"texts": {
			"en-US": {
				"/sap.card/header/title": "My Configured Title in US-English"
			}
		}
	},
	{
		// Page administrator
		"/sap.card/content/maxItems": 5
	},
	{
		// End user
     "/sap.card/header/title": "Title by End User",
		"/sap.card/content/maxItems": 8
	}
]

Specifies if the total values should be displayed in the group headers or on bottom of the row. Does not affect the total sum.

The value of the property is only taken into account if no parameter is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the rows aggregation is done.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      sumOnTop: true
    }
  });

Number of levels, which should be opened initially (on first load of data).

The value of the property is only taken into account if no parameter is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the rows aggregation is done.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      numberOfExpandedLevels: 1
    }
  });

The kind of auto expansion algorithm, e.g. optimized filter conditions, per level requests, ... Must be a value of sap.ui.table.TreeAutoExpandMode.

The value of the property is only taken into account if no parameter is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the rows aggregation is done.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      autoExpandMode: "Bundled"
    }
  });

Setting collapseRecursive to true means, that when collapsing a node all subsequent child nodes will also be collapsed.

Calling the setter of this property only has an effect when the tables rows aggregation is already bound and the binding supports this feature.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      collapseRecursive: true
    }
  });

Specifies whether the first level is expanded.

The value of the property is only taken into account if no parameter numberOfExpandedLevels is given in the binding information. Changes to this property after the table is bound do not have any effect unless an explicit (re-)bind of the rows aggregation is done.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      numberOfExpandedLevels: 1
    }
  });

Setting collapseRecursive to true means, that when collapsing a node all subsequent child nodes will also be collapsed. This property is only supported with sap.ui.model.odata.v2.ODataModel. Note: collapseRecursive is currently not supported if your OData service exposes the hierarchy annotation hierarchy-node-descendant-count-for. In this case the value of the collapseRecursive property is ignored. For more information about the OData hierarchy annotations, please see the SAP Annotations for OData Version 2.0 specification.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      collapseRecursive: true
    }
  });

The root level is the level of the topmost tree nodes, which will be used as an entry point for OData services. This property is only supported when the TreeTable uses an underlying odata services with hierarchy annotations. This property is only supported with sap.ui.model.odata.v2.ODataModel The hierarchy annotations may also be provided locally as a parameter for the ODataTreeBinding.

Example: 
  oTable.bindRows({
    path: "...",
    parameters: {
      rootLevel: 1
    }
  });

A callback function that gets a tooltip for a given {@link sap.ui.vtm.SceneNode}. If unspecified, the scene node name is used for the tooltip text.

The first parameter is the {@link sap.ui.vtm.SceneNode} under cursor. The function should return an object containing a tooltip text for the specified scene node. 
  {
    text: [string]
  }
 If function returns null no tooltip will be displayed.
